script: |
  super -f text -I q12591.spq | sort > q12591.out

inputs:
  - name: q12591.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE + 33 * - - 61 / col0 + - + col1 NOT BETWEEN - col0 * - col1 AND ( + - col2 + + + col2 );
  - name: tab2

outputs:
  - name: q12591.out
    data: |
      46	51	23
      64	77	40
      75	67	58
